import base64
import io

# Assuming you have the JSON response received from the server as response_json
response_json = {
        "pdf_content": "",
        
      
      
      
        
    
    "pdf_url": "",
    "message": "URL generation successful"
}
encoded_pdf_content = response_json["pdf_content"]

decoded_pdf_content = base64.b64decode(encoded_pdf_content)

output_file_path = "output.pdf"
with io.BytesIO(decoded_pdf_content) as file:
    with open(output_file_path, "wb") as f:
        f.write(file.read())

print("PDF file saved as:", output_file_path)
